# Python Challenge Problem 3
# One small letter, surrounded by EXACTLY three big bodyguards on each
# of its sides.
# I think we have to search through the string and filter out only the
# lower-case letters in between 3 upper-case letters on either side. 
import re
import string

cString = ""

# find non-overlapping pattern 'XXXxXXX'
results = re.findall(r"[A-Z][A-Z][A-Z][a-z][A-Z][A-Z][A-Z]", cString)
# find overlapping pattern 'XXXxXXX'
#matches = re.finditer(r"[A-Z][A-Z][A-Z][a-z][A-Z][A-Z][A-Z]", cString)
#results = [match.group(0) for match in matches]

# convert list 'match' back to string
cString1 = ''.join(results)
# filter out all upper-case letters from string
cleanStr = cString1.translate(None, string.uppercase)

print(cleanStr)
